// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Cabecalho from './components/Cabecalho';
import Login from './components/Login';
import TestLogin from './TestLogin'; // Importe o componente de teste
import './App.css';

const App = () => {
  return (
    <Router>
      <div>
        <Cabecalho />
        <Switch>
          <Route path="/login" component={Login} />
          <Route path="/test-login" component={TestLogin} /> {/* Nova rota para o componente de teste */}
        </Switch>
      </div>
    </Router>
  );
};

export default App;
